#### TypeScript SDK Code Sample

```typescript
import { createClient } from 'liferay-headless-rest-client';
import { getDiscountAccountAccount } from 'liferay-headless-rest-client/headless-commerce-admin-pricing-v2.0';

const client = createClient({
    baseUrl: 'http://localhost:8080',
    headers: {
        Authorization: `Basic ${btoa("test@liferay.com:test")}`,
    },
});

async function main() {
    const { data } = await getDiscountAccountAccount({
        client,
        path: {
           discountAccountId: "3678",
        },
    });

    console.log(data);
}
```
#### Java installation:

Liferay Commerce Admin Pricing API. A Java client JAR is available for use with the group ID 'com.liferay', artifact ID 'com.liferay.headless.commerce.admin.pricing.client', and version '4.0.40'.

```gradle
implementation group: "com.liferay", name: "com.liferay.headless.commerce.admin.pricing.client", version: "latest"
```

Reference: https://mvnrepository.com/artifact/com.liferay/com.liferay.headless.commerce.admin.pricing.client/latest

