import { createClient } from 'liferay-headless-rest-client';
import { getDiscountAccountAccount } from 'liferay-headless-rest-client/headless-commerce-admin-pricing-v2.0';

const client = createClient({
    baseUrl: 'http://localhost:8080',
    headers: {
        Authorization: `Basic ${btoa("test@liferay.com:test")}`,
    },
});

async function main() {
    const { data } = await getDiscountAccountAccount({
        client,
        path: {
           discountAccountId: "3004",
        },
    });

    console.log(data);
}

